    #[doc = ""]
    #[doc = " `allowed_changes` can have the following flags OR'd together:"]
    #[doc = ""]
    #[doc = " - `SDL_AUDIO_ALLOW_FREQUENCY_CHANGE`"]
    #[doc = " - `SDL_AUDIO_ALLOW_FORMAT_CHANGE`"]
    #[doc = " - `SDL_AUDIO_ALLOW_CHANNELS_CHANGE`"]
